//import liraries
import { StatusBar } from 'expo-status-bar';
import React, { Component } from 'react';
import { View, Text, StyleSheet,Image,ScrollView } from 'react-native';
import { Card } from 'react-native-elements/dist/card/Card';
import { TouchableOpacity } from 'react-native-gesture-handler';
import { SafeAreaView } from 'react-native-safe-area-context';

// create a component
const First = () => {
    return (

        <ScrollView>
       <SafeAreaView style={styles.container}>
           
             <View style={{flex:1,flexWrap:'wrap',justifyContent:'space-evenly'}}>
                 <View style={styles.card}>
                     <View style={styles.img}>
                          <Image
                            source={{uri:'https://play-lh.googleusercontent.com/oHQRntEoYcddMoxpBmmrrhtsh8u551MsiEwwJbTjCluIREUuRDNNFRjbjm0b5nCtj5DV'}}

                            style={{height:290,width:250,borderRadius:10}}
                            resizeMode='cover'
                          />
                     </View>
                     <View style={styles.btn}>
                     <TouchableOpacity>
                         <Text>Read</Text>
                     </TouchableOpacity>
                     </View>
                 </View>


                 <View style={styles.card}>
                     <View style={styles.img}>
                          <Image
                            source={{uri:'https://play-lh.googleusercontent.com/oHQRntEoYcddMoxpBmmrrhtsh8u551MsiEwwJbTjCluIREUuRDNNFRjbjm0b5nCtj5DV'}}

                            style={{height:290,width:250,borderRadius:10}}
                            resizeMode='cover'
                          />
                     </View>
                     <View style={styles.btn}>
                     <TouchableOpacity>
                         <Text>Read</Text>
                     </TouchableOpacity>
                     </View>
                 </View>


                 <View style={styles.card}>
                     <View style={styles.img}>
                          <Image
                            source={{uri:'https://play-lh.googleusercontent.com/oHQRntEoYcddMoxpBmmrrhtsh8u551MsiEwwJbTjCluIREUuRDNNFRjbjm0b5nCtj5DV'}}

                            style={{height:290,width:250,borderRadius:10}}
                            resizeMode='cover'
                          />
                     </View>
                     <View style={styles.btn}>
                     <TouchableOpacity>
                         <Text>Read</Text>
                     </TouchableOpacity>
                     </View>
                 </View>


                 <View style={styles.card}>
                     <View style={styles.img}>
                          <Image
                            source={{uri:'https://play-lh.googleusercontent.com/oHQRntEoYcddMoxpBmmrrhtsh8u551MsiEwwJbTjCluIREUuRDNNFRjbjm0b5nCtj5DV'}}

                            style={{height:290,width:250,borderRadius:10}}
                            
                          />
                     </View>
                     <View style={styles.btn}>
                     <TouchableOpacity>
                         <Text>Read</Text>
                     </TouchableOpacity>
                     </View>
                 </View>

             </View>
            
        </SafeAreaView>
        </ScrollView>
    );
};

// define your styles
const styles = StyleSheet.create({
    container: {
        flex: 1,
        alignItems:'center'
        
    },
    card:{
        height:350,width:260,borderRadius:10,marginTop:10,
        shadowColor:'black',
        borderWidth:1,
        

    },
    img:{
        alignItems:'center',
        marginTop:10
    },
    btn:{
        borderWidth:1,
        height:50,
        alignItems:'center',
        justifyContent:'center'
        
        
    }
    
});

//make this component available to the app
export default First;
